import React from 'react';
import { StyleSheet, View } from 'react-native';

export default function Ex10() {
  return (
    <View style={styles.container}>
    </View>
  )
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: 'column',
    backgroundColor: '#4A90E2',
  },
});
